import a from './12.png';
import b from './11.png';
import c from './10.png';
import d from './9.png';
import e from './8.png';

const TvExtra = [
    {
    id: 1,
    image: a,
    name: 'Panji Milenium',
    year: '2012'
    },{
    id: 2,
    image: b,
    name: 'Arrow',
    year: '2017'
    },{
    id: 3,
    image: c,
    name: '1988',
    year: '2014'
    },{
    id: 4,
    image: d,
    name: 'Neighbor love',
    year: '2014'
    },{
    id: 5,
    image: e,
    name: 'Ocke Key',
    year: '2019'
    }
];


export default TvExtra;
